    <script type="text/javascript">
        // 定義畫布
        var canvas = new fabric.Canvas('c');
        // 畫布大小依據
        var desktop = document.querySelector('.deskWidth');
        // 從結構中得到上傳的圖片路徑 (Base64)
        var imgElement = document.getElementById('clientImg').getAttribute('src');
        // 使用者上傳的照片
        var img = imgElement;
        // ------------------------------------

        // !需更換內容
        // 框框圖片連結替換成上一頁選擇的框
        // 
        var frame = 'content/img/frame01.png';

        // -------------------------------------
        // 讓圖片符合畫布大小
        function resizeimg() {
            // console.log(desktop.width);
            fabric.Image.fromURL(img, function(img) {
                canvas.setBackgroundImage(img, canvas.renderAll.bind(canvas), {
                    scaleX: desktop.clientWidth / img.width,
                    scaleY: desktop.clientHeight / img.height,
                    originX: 'left',
                    originY: 'top'
                });
            })
        }
        // 選擇的框框 
        function wireimg() {
            fabric.Image.fromURL('content/img/frame01.png', function(img) {
                var oImg = img.set({
                    left: 0,
                    bottom: 0,
                    scaleX: desktop.clientWidth / img.width,
                    scaleY: desktop.clientHeight / img.height,
                });
                canvas.add(oImg);
                oImg.selectable = false;

            });
        }

        // 增加文字欄
        var textbox = new fabric.Textbox('在此輸入心情', {
            left: 150,
            top: 50,
            width: 100,
            fontSize: 20,
            fill: '#fff',
            borderColor: '#4975DD',
            transparentCorners: false,
            cornerSize: 6,

        });

        canvas.add(textbox);
        canvas.setActiveObject(textbox);


        // 改變大小時重新計算畫布大小
        window.addEventListener('resize', resizeCanvas, false);

        function resizeCanvas() {
            canvas.setHeight(desktop.clientHeight);
            canvas.setWidth(desktop.clientWidth);
            resizeimg();
            canvas.renderAll();
        }
        // frame框 init
        wireimg();
        // resize on init
        resizeCanvas();
        // 儲存canvas

        document.querySelector('.nextBtn').addEventListener('click', function(event) {
            event.preventDefault();
            // 要送出的base64
            canvas.toDataURL();
            console.log(canvas.toDataURL());
            // 送出後轉跳
            window.location.href = 'done.html';
        })

    </script>
